"use strict";let allLibraries;function onStart(){$("#back").click(function(){location.assign("plex_configuration.html")});$("#search").click(function(){let obj=JSON.parse(document.cookie);if(!obj.dialogDontShowAgain){if(validateInput()){$("#warningModal").modal("open")}}else{if(validateInput()){updatedSelectedLibraries();location.assign("plex_movie_list.html")}}});$("#agree").click(function(){if(validateInput()){let obj=JSON.parse(document.cookie);obj.dialogDontShowAgain=$("#dialogDontShowAgain").is(":checked");document.cookie=JSON.stringify(obj);updatedSelectedLibraries();location.assign("plex_movie_list.html")}});setPreloaderVisibility(true);getLibraries();M.AutoInit();M.updateTextFields();document.addEventListener("DOMContentLoaded",function(){var a=document.querySelectorAll(".modal");M.Modal.init(a)})}function setPreloaderVisibility(a){$("#progressBar").toggle(a)}function setSearchEnabled(a){if(a){$("#search").removeClass("disabled")}else{$("#search").addClass("disabled")}}function clearLibrariesAndErrors(){$("#libraryException").html("");$("#libraryCheckboxes").html("")}function getLibraries(){setSearchEnabled(false);clearLibrariesAndErrors();let obj=JSON.parse(document.cookie);let token=obj.plex_token;let port=obj.port;let address=obj.address;if(!token||!port||!address){console.warn("Could not find plex token, port, or address in cookies");M.toast({html:"Could not find plex token, port, or address in cookies"});return}let data={token:token,port:port,address:address};$.ajax({type:"GET",url:"http://"+location.hostname+":"+location.port+"/getPlexLibraries?"+encodeQueryData(data),contentType:"application/json",success:function(a){allLibraries=a;setPreloaderVisibility(false);setSearchEnabled(true);generateLibrariesCheckbox(a)},error:function(){setPreloaderVisibility(false);setSearchEnabled(false);setErrorMessage()}})}function encodeQueryData(b){const a=[];for(let d in b){a.push(encodeURIComponent(d)+"="+encodeURIComponent(b[d]))}return a.join("&")}function validateInput(){let selectedLibraries=findSelectedLibraries();if(selectedLibraries===undefined||selectedLibraries.length==0){M.toast({html:"Must select at least one library"});return false}return true};